      SELECT ALL + ( col2 ) FROM tab0 (FORMAT parquet) WHERE NOT - 73 BETWEEN CAST ( - 95 AS INTEGER ) AND - col0 AND NULL IS NULL;
  - name: tab0

outputs:
  - name: q12665.out
    data: |
      10
      99
